import React from 'react';
import Entry from './Entry';
import Emojipedia from "../emojipedia";

var meaning = Emojipedia.map(emoji => emoji.meaning.substring(0,10));

console.log(meaning);

function App() {
	return(
		<div>
			<h1>
				<span>emojipedia</span>
			</h1>
			<dl className="dictionary">{Emojipedia.map( data => <Entry data={data}/> 
			 )}</dl>
		</div>
	)
}

export default App;
